import React from "react";

import classes from "./Todo.module.css";

const Todo = (props) => {
  const deleteHandler = () => {
    props.onDelete(props.id);
  };
  return (
    <li className={classes.todo} onClick={deleteHandler}>
      <h2>{props.title}</h2>
      <p>{props.openingText}</p>
    </li>
  );
};

export default Todo;
